import React from "react";
import { view, Text, View } from "react-native";
import Subtitulo from "./Subtitulo";

const Titulo = () => {
  return (
    <View>
      <Text>Este es el Titulo del componente</Text>
      <Subtitulo></Subtitulo>
    </View>
  );
};

export default Titulo;
